export var CallToActionAppearance;
(function (CallToActionAppearance) {
    CallToActionAppearance["justified"] = "justified";
    CallToActionAppearance["lightweight"] = "lightweight";
    CallToActionAppearance["outline"] = "outline";
    CallToActionAppearance["primary"] = "primary";
    CallToActionAppearance["stealth"] = "stealth";
})(CallToActionAppearance || (CallToActionAppearance = {}));
